export default function Lista(props){
    return(<div id="listaHerramientas">
        <ul>
            {props.productos.map((item, index) => {
                return(
                    <li className="tarjeta" key={index} onClick={()=>console.log(item.id)}>
                        <div>
                            <img src={item.images[0]}></img>
                        </div>
                        <div>
                            <p>{item.title}</p>
                        </div>
                    </li>
                )
            })}
        </ul>
    </div>
    )
}
